import React, { useState } from "react";

export default function LoginForm(){
    let [user,setUser]=useState({usn:"",pswd:""});

    function updateUsn(e){
        setUser((u)=>{
            return {...u,usn: e.target.value};
        });
    }

    function updatePswd(e){
        setUser((u)=>{
            return {...u,pswd: e.target.value};
        });
    }

    return(
        <>
        <section className="container-fluid mt-3">
            <div className="row">
                <div className="col-5 m-auto">
                    <div className="card">
                        <div className="card-header bg-dark text-white text-center">
                            <h1>Login Form</h1>
                        </div>
                        <div className="card-body">
                            <form action="">
                                <div className="mb-2">
                                    <input type="text" placeholder="Enter Username" value={user.usn} onChange={updateUsn}/>
                                </div>

                                <div className="mb-2">
                                    <input type="text" placeholder="Enter Password" value={user.pswd} on/>
                                </div>
                                <input type="submit" value="Login" />
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </section>
        </>
    );
}
